B.QI=new A.br(B.RA,["Experience","SPT1","Spear Strike tier 1","Initiates a spear combo with a basic attack that deals 50 damage.\nThe damage is repeated every second for 10 seconds.","SPT2","Spear Strike tier 2","Continues the spear combo with a medium attack that deals 100 damage, with an additional bonus if tier 1 is active.\nThe damage is repeated every second for 10 seconds.","SPT3","Spear Strike tier 3","Continues the spear combo with an advanced attack that deals 150 damage, with an additional bonus if tiers 1 and 2 are active.\nThe damage is repeated every second for 10 seconds.","SPT4","Spear Strike tier 4","Ends the spear combo with a supreme attack that deals 200 damage, with an additional bonus if tiers 1, 2 and 3 are active.\nThe damage is repeated every second for 10 seconds.","SHT1","Heal tier 1","Initiates a shield combo that performs a basic heal of 50 health.\nThe recovery is repeated every second for 10 seconds.","SHT2","Heal tier 2","Continues the shield combo by performing a basic heal of 100 health, with an additional bonus if tier 1 is active.\nThe recovery is repeated every second for 10 seconds.","SHT3","Heal tier 3","Continues the shield combo by performing a basic heal of 100 health, with an additional bonus if tiers 1 and 2 are active.\nThe recovery is repeated every second for 10 seconds.","SHT4","Heal tier 4","Continues the shield combo by performing a basic heal of 100 health, with an additional bonus if tiers 1, 2 and 3 are active.\nThe recovery is repeated every second for 10 seconds.","FE1","Fear tier 1","Initiates a shout combo with a basic attack that deals 50 damage.\nThe damage is repeated every second for 10 seconds.\nAdditionally, it applies an effect to the enemy with a 5% chance to enter the Fear state for 10 seconds.\nAll tier probabilities are cumulative.","FE2","Fear tier 2","Initiates a shout combo with a basic attack that deals 100 damage.\nThe damage is repeated every second for 10 seconds.\nAdditionally, it applies an effect to the enemy with a 5% chance to enter the Fear state for 10 seconds.\nAll tier probabilities are cumulative.","FE3","Fear tier 3","Initiates a shout combo with a basic attack that deals 150 damage.\nThe damage is repeated every second for 10 seconds.\nAdditionally, it applies an effect to the enemy with a 5% chance to enter the Fear state for 10 seconds.\nAll tier probabilities are cumulative.","FE4","Fear tier 4","Initiates a shout combo with a basic attack that deals 200 damage.\nThe damage is repeated every second for 10 seconds.\nAdditionally, it applies an effect to the enemy with a 5% chance to enter the Fear state for 10 seconds.\nAll tier probabilities are cumulative.","DA1","Daze tier 1",u._,"DA2","Daze tier 2",u._,"DA3","Daze tier 3",u._,"DA4","Daze tier 4",u._,"ST1","Shield Physical Protection","For 60 seconds, the player mitigates 50% of the damage received from physical attacks.","SM1","Shield Tactical Protection","For 60 seconds, the player is immune to Fear and Daze states.","PW1","Power Recovery tier 1","Performs a combo that converts 150 of the player's health into power.","Warden Gambits System","by","Oscar Mart\xednez G\xf3mez","Experience","COMBAT","GAMBITS LIST","CONFIGURATION","PLAYER RESET","INVENTORY","SAVE","ACCEPT","CANCEL","Warning, you are about to reset the player and all of their progress.\n\nEnter the new player name","Language","Write Method","Theme","Music and Fx","ABOUT ...","PLAYER WINS","RIVAL WINS","Choose reward...","Recovers 30% of maximum health instantly","Recovers 10% of maximum power instantly","Bree Leather Chestplate","A light leather armor tanned in Bree, simple yet reliable.","Elven Leather Chestplate","Flexible and silent elven leather, crafted with ancient skill.","Elven Iron Chestplate","Elven-forged iron, light and surprisingly resilient.","Dwarven Iron Chestplate","Sturdy armor forged in the mountains by dwarven hands.","Gondor Steel Chestplate","Tempered steel from Gondor, a symbol of discipline and honor.","Mithril Chestplate","Forged from pure mithril, light as a feather and hard as steel.","Bree Leather Leggings","Basic leather protection, comfortable for long journeys.","Elven Leather Leggings","Refined leather that allows silent movement.","Elven Iron Leggings","Light elven plates that protect without hindering movement.","Dwarven Iron Leggings","Thick iron designed to withstand direct blows.","Gondor Steel Leggings","Standard military protection of Gondor\u2019s armies.","Mithril Leggings","Interwoven mithril offering legendary protection.","Bree Leather Pauldrons","Simple pauldrons used by guards and travelers.","Elven Leather Pauldrons","Elegant elven pauldrons with great flexibility.","Elven Iron Pauldrons","Elven iron shaped to deflect incoming blows.","Dwarven Iron Pauldrons","Heavy plates designed to resist powerful charges.","Gondor Steel Pauldrons","Solid protection worn by veteran soldiers.","Mithril Pauldrons","Polished mithril combining defense and lightness.","Bree Leather Gloves","Simple gloves that protect the hands from wear.","Elven Leather Gloves","Soft gloves that enhance precision.","Mithril Gloves","Legendary gloves that never sacrifice mobility.","Old Wood Shield","A rudimentary shield carved from hardened wood.","Elven Iron Shield","A well-balanced shield, both resilient and elegant.","Dwarven Iron Shield","A massive shield capable of stopping devastating blows.","Gondor Steel Shield","Military shield bearing the emblem of Gondor.","Mithril Shield","A legendary shield, nearly indestructible.","Old Wood Sword","A training weapon or a last resort.","Elven Iron Sword","A light and razor-sharp blade forged by elves.","Dwarven Iron Sword","A sturdy sword built for powerful strikes.","Gondor Steel Sword","A noble weapon used by the defenders of the realm.","Mithril Sword","A legendary blade with an eternal edge.","Bree Leather Helmet","A light helmet offering basic protection.","Elven Leather Helmet","A discreet helmet that does not limit vision.","Elven Iron Helmet","Refined protection with an elven design.","Dwarven Iron Helmet","A heavy helmet built to withstand heavy impacts.","Gondor Steel Helmet","Official helmet of Gondor\u2019s army.","Mithril Helmet","A legendary helmet of unmatched resistance.","Bree Cloak","A simple cloak that protects against cold and rain.","Elven Cloak","An elven cloak that helps the wearer remain unseen.","Mithril Cloak","A rare cloak reinforced with mithril threads.","Bree Leather Boots","Sturdy boots for long roads.","Elven Leather Boots","Silent and lightweight boots.","Mithril Boots","Legendary boots that feel weightless when worn.","Ring of Bree","A simple ring worn by the men of Bree.","Elven Ring","An ancient ring imbued with elven wisdom.","Dwarven Ring","A heavy ring symbol of wealth and power.","Dark Ring","A forbidden ring of power that corrupts its bearer.","Earring of Bree","A simple earring worn by the men of Bree.","Elven Earring","An ancient earring imbued with elven wisdom.","Dwarven Earring","A heavy earring symbol of wealth and power.","Dark Earring","A forbidden earring of power that corrupts its bearer.","Necklace of Bree","A simple necklace worn by the men of Bree.","Elven Necklace","An ancient necklace imbued with elven wisdom.","Dwarven Necklace","A heavy necklace symbol of wealth and power.","Dark Necklace","A forbidden necklace of power that corrupts its bearer.","Bracelet of Bree","A simple bracelet worn by the men of Bree.","Elven Bracelet","An ancient bracelet imbued with elven wisdom.","Dwarven Bracelet","A heavy bracelet symbol of wealth and power.","Dark Bracelet","A forbidden bracelet of power that corrupts its bearer.","Buckle of Bree","A simple buckle worn by the men of Bree.","Elven Buckle","An ancient buckle imbued with elven wisdom.","Dwarven Buckle","A heavy buckle symbol of wealth and power.","Dark Buckle","A forbidden buckle of power that corrupts its bearer.","Warden is a turn-based strategic combat game strongly inspired by dark fantasy.\n\nThe player takes on the role of a lone guardian who must face a series of enemies using skill, tactics, and careful combat management. Each encounter is not based solely on raw strength, but on choosing the right actions and mastering the combo system.\n\nCombat revolves around chained combos. Each action can empower the next, unlocking additional bonuses when executed in the correct order. Learning how to maintain active effects and combine different attack tiers is essential for survival and progression.\n\nWarden is designed to deliver a clean and focused experience, featuring a minimalist interface and a carefully crafted atmosphere. Under the hood, the game is built using modern technology, with Flutter as its core engine, allowing for solid performance and continuous evolution.\n\nThis game is an ongoing project, developed with passion, experimentation, and attention to detail, where every battle matters.\n\n\nThe font code is in github\n\nhttps://github.com/pakmg2355/Warden\n\nAny improvement or comment will be welcome\n\n","Snag-Kar","Gor-Muk","Ush-Nak","Rak-Zul","Mor-Gash","Kru-Nok","Zar-Gul","Thak-Mor","Ugr-Nesh","Bog-Rak","Ur-Mak","Dru-Gor","Naz-Kur","Krag-Mul","Uruk-Zhar","Bol-Drak","Sha-Gor","Hor-Kun","Kap-Zul","Is-Mor","Gor-Bak","Thra-Kur","Ur-Dash","Mor-Zag","Uruk-Khan","Zug-Dor","Rak-Thar","Krag-Hul","Kui-Vor","Lot-Ner","Kra-Shin","Olog-Tui","Troll-Kai","Gash-Nor","Best-Rai","Tull-Hai","Olog-Ven","Ur-Dur","Troll-War","Mor-Champ","Sha-Pass","Ring-Wraith","Morg-Ace","Dark-Serv","Eye-Guard","Night-Her","War-Spirit","Anc-Shadow","Morg-Lieut","Eye-Champ"],t.li)
